import React from 'react';
import "EDemand.jpg"


import { Brand, Feature, Navbar} from './components';
import { Footer, Features, Header} from './containers';

import './App.css';

const App = () => (
    <div className="App">
     <div className="gradient__bg">
        <Navbar />
        <Header />
        <img src="EDemand.jpg" />
      </div>
      <Brand />
      <Feature />
      <Features />
      <Footer />

    </div>
  );

export default App;
